import React, { useState } from 'react'
import { createTheme, CssBaseline, Paper, ThemeProvider } from '@mui/material';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import SMInput from '../config/components/input';
import InputLabel from '@mui/material/InputLabel';
import SMButton from '../config/components/button';
import { sendData, sendingData } from '../config/firebase/firebasemethods';
import { Container } from '@mui/system';
import { useNavigate } from "react-router-dom";



const Form = () => {
    let [saveData, setSaveData] = useState([])

  const navigate = useNavigate()


    const theme = createTheme();


    const sendfunc = () => {
       
        sendData(saveData, 'course').then(() => {
            console.log("data transfer")
            navigate("/news")

        }).catch((err) => {
            console.log(err)
        })

        console.log(saveData)

    }


    return (
        <Box>
            <Typography>Form</Typography>

            <ThemeProvider theme={theme}>
                <Container component="main" maxWidth="xs">
                    <CssBaseline />
                    <Box
                        sx={{
                            marginTop: 8,
                            display: 'flex',
                            flexDirection: 'column',
                            alignItems: 'center',
                        }}
                    >

                        <Typography component="h1" variant="h5">
                            form
                        </Typography>
                        <Box >

                            <SMInput
                                margin="normal"
                                onChange={(e) => { setSaveData({ ...saveData,class: e.target.value }) }}
                                required
                                name="password"
                                label="Class"
                                type="text"
                                id="password"
                                autoComplete="current-password"
                            />
                            <SMInput
                                margin="normal"
                                onChange={(e) => { setSaveData({ ...saveData,section: e.target.value }) }}
                                required
                                label="Section"
                                type="text"
                                autoFocus
                            />
                            <SMInput
                                margin="normal"
                                onChange={(e) => { setSaveData({ ...saveData, dateofstart: e.target.value }) }}
                                required
                                type="date"
                                autoComplete="current-password"
                            />
                            <SMInput
                                margin="normal"
                                required
                                onChange={(e) => { setSaveData({ ...saveData, dateofend: e.target.value }) }}
                                type="date"
                                autoComplete="current-password"
                            />
                            <SMInput
                                margin="normal"
                                required
                                label="Required Qualification"
                                onChange={(e) => { setSaveData({ ...saveData, qualification: e.target.value }) }}
                                type="text"
                                autoComplete="current-password"
                            />
                            <SMButton
                                type="submit"
                                label="Submit"
                                fullWidth
                                variant="contained"
                                onClick={sendfunc}
                                sx={{ mt: 3, mb: 2 }}

                                Submit
                            />

                        </Box>
                    </Box>
                </Container>
            </ThemeProvider>
        </Box>                
            )
}
export default Form;
